const ResultadoDivisao = ({ resultado, x, y }) => {
    if (!resultado) return null;

    const divisiveis = [];
    for (let i = x; i <= y; i++) {
        const divisivel = resultado % i === 0;
        divisiveis.push(`${resultado} / ${i} = ${resultado / i} (${divisivel ? 'Divisível' : 'Não Divisível'})`);
    }
    return (
        <section className="resultado-divisao">
            <h2>Resultados das Divisões</h2>
            <ul>
                {divisiveis.map((item, index) => (
                    <li key={index}>{item}</li>
                ))}
            </ul>
        </section>
    );
}

export default ResultadoDivisao;
